import React from "react";
import PropTypes from "prop-types";
import { Link } from "react-router-dom";
import Card from "pnnl-react-core/lib/Card";
import Grid from "react-bootstrap/es/Grid";
import ResultsTable from "./ResultsTable";
import LcsGraph from "./LcsGraph";
import LCSGoogleGraph from "./LCSGoogleGraph";
import LHSGoogleGraph from "./LHSGoogleGraph";
import LCFGoogleGraph from "./LCFGoogleGraph";
import LCSd3 from "./LCSd3";
import ModalImage from "react-modal-image";

var tm30_data;

class Report extends React.Component {
  render() {
    return (
      <Grid>
        <h1>Report Page</h1>
        <br />
        {!(this.props.location.state == null) ? (
          <div>
            {
              // <ResultsTable data={this.props.location.state.data} />
            }
          </div>
        ) : (
          <Card>
            <h2>No data Calculated</h2>
            <h5>
              <ol>
                <li>Click on Calculator above</li> <br />
                <li>Choose which way to calculate data</li> <br />
                <li>Click Calculate and you will be redirected here</li>
              </ol>
            </h5>
          </Card>
        )}
        {!(this.props.location.state == null) ? (
          <div>
            <Card>
              <table>
                <tr>
                  <th>Variable</th>
                  <th>Test</th>
                  <th>Ref</th>
                </tr>
                <tr>
                  <td>CCT</td>
                  <td>
                    {
                      this.props.location.state.data.tm30.Numerical_Results
                        .CCT[0]
                    }
                  </td>
                  <td>
                    {
                      this.props.location.state.data.tm30.Numerical_Results
                        .CCT[1]
                    }
                  </td>
                </tr>
                <tr>
                  <td>DUV</td>
                  <td>
                    {" "}
                    {
                      this.props.location.state.data.tm30.Numerical_Results
                        .DUV[0]
                    }
                  </td>
                  <td>
                    {" "}
                    {
                      this.props.location.state.data.tm30.Numerical_Results
                        .DUV[1]
                    }
                  </td>
                </tr>
                <tr>
                  <td>u</td>
                  <td>
                    {" "}
                    {this.props.location.state.data.tm30.Numerical_Results.u[0]}
                  </td>
                  <td>
                    {" "}
                    {this.props.location.state.data.tm30.Numerical_Results.u[1]}
                  </td>
                </tr>
                <tr>
                  <td>v</td>
                  <td>
                    {" "}
                    {this.props.location.state.data.tm30.Numerical_Results.v[0]}
                  </td>
                  <td>
                    {" "}
                    {this.props.location.state.data.tm30.Numerical_Results.v[1]}
                  </td>
                </tr>
              </table>
            </Card>
            <br />
            <LCSGoogleGraph
              data={
                this.props.location.state.data.tm30.Numerical_Results
                  .local_chroma_shift
              }
            ></LCSGoogleGraph>

            <br />

            <LHSGoogleGraph
              data={
                this.props.location.state.data.tm30.Numerical_Results
                  .local_hue_shift
              }
            ></LHSGoogleGraph>

            <br />

            <LCFGoogleGraph
              data={
                this.props.location.state.data.tm30.Numerical_Results
                  .local_color_fidelity
              }
            ></LCFGoogleGraph>
            <br />
            <Paper>
              <LCSd3 />
            </Paper>
          </div>
        ) : (
          /*
          <div class="reportImage">
            <ModalImage
              small="http://localhost:8000/tm30_output.png"
              large="http://localhost:8000/tm30_output.png"
              alt=""
            />
          </div>
        */
          <div></div>
        )}
      </Grid>
    );
  }
}

export default Report;
